export const Badges = () => {
  return (


<div className="mx-4">
  <div className="flex space-x-11">
    {/* Badge 1 */}
    <div className="w-1/4 bg-white rounded-lg shadow-md text-center p-4">
      <img src="icon1.png" alt="Icon 1" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Badge 1 Text</p>
    </div>

    {/* Badge 2 */}
    <div className="w-1/4 bg-white rounded-lg shadow-md text-center p-4">
      <img src="icon2.png" alt="Icon 2" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Badge 2 Text</p>
    </div>

    {/* Badge 3 */}
    <div className="w-1/4 bg-white rounded-lg shadow-md text-center p-4">
      <img src="icon3.png" alt="Icon 3" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Badge 3 Text</p>
    </div>

    {/* Badge 4 */}
    <div className="w-1/4 bg-white rounded-lg shadow-md text-center p-4">
      <img src="icon4.png" alt="Icon 4" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Badge 4 Text</p>
    </div>
  </div>
</div>



  );
};
export default Badges;
